import React from 'react';

function Upsc() {
  return (
  <>
  <div class="container">
	 <div class="row">
	 <div class="col-sm-6">
	 <h3><b>UPSC</b> PATHSHALA</h3>
	 <h1>Best Online Coaching for UPSC Preparation </h1>
	 <div class="container">
	 <img src="https://media.istockphoto.com/photos/happy-students-walking-together-in-campus-having-break-picture-id1165683016?k=20&m=1165683016&s=612x612&w=0&h=Rzay--91ScZFiD-eJL6o6jA3v3AUBokbaOEjxgPGzSQ="height="40px" width="40px"/>
	 <h5 className="centered">Thousands of students from all over India trust UPSC Pathshala for IAS preparation.</h5>
	 <h5 className="centered">Now,it's <b>your</b> chance to clear UPSC! </h5> 
	</div>
</div>
</div>
</div>	
  </>
  );
}

export default Upsc;
